    useEffect(() => {
        console.log('WatchList re-rendered with updated favList:', favList);
    }, [favList]);

    return (
        <div className="container-fluid mt-4 ms-4">
            <p style={{ fontSize: "32px", fontWeight: 600 }}>Watch List</p>
        </div>
    )
}
